import React, { useState } from 'react';
import './App.css'; // Puedes crear este archivo para estilos propios

function App() {
  // Estado para el carrito
  const [cart, setCart] = useState([]);

  // Funci贸n para agregar productos al carrito
  const addToCart = (product) => {
    setCart([...cart, product]);
  };

  // Funci贸n para vaciar carrito
  const clearCart = () => {
    setCart([]);
  };

  return (
    <div className="container py-4">
      <h1 className="text-center mb-4">Tienda Online</h1>

      <div className="row">
        {/* Producto 1 */}
        <div className="col-md-4">
          <div className="card">
            <img src="baleta1.jpg" className="card-img-top" alt="Baleta 1" />
            <div className="card-body">
              <h5 className="card-title">Baleta Cl谩sica</h5>
              <p className="card-text">$40.000</p>
              <button
                className="btn btn-primary"
                onClick={() =>
                  addToCart({ name: 'Baleta Cl谩sica', price: 40000 })
                }
              >
                Agregar al carrito
              </button>
            </div>
          </div>
        </div>

        {/* Producto 2 */}
        <div className="col-md-4">
          <div className="card">
            <img src="baleta2.jpg" className="card-img-top" alt="Baleta 2" />
            <div className="card-body">
              <h5 className="card-title">Baleta Moderna</h5>
              <p className="card-text">$45.000</p>
              <button
                className="btn btn-primary"
                onClick={() =>
                  addToCart({ name: 'Baleta Moderna', price: 45000 })
                }
              >
                Agregar al carrito
              </button>
            </div>
          </div>
        </div>

        {/* Producto 3 */}
        <div className="col-md-4">
          <div className="card">
            <img src="baleta3.jpeg" className="card-img-top" alt="Baleta 3" />
            <div className="card-body">
              <h5 className="card-title">Baleta Elegante</h5>
              <p className="card-text">$50.000</p>
              <button
                className="btn btn-primary"
                onClick={() =>
                  addToCart({ name: 'Baleta Elegante', price: 50000 })
                }
              >
                Agregar al carrito
              </button>
            </div>
          </div>
        </div>
      </div>

      {/* Mostrar Carrito */}
      <div className="mt-5">
        <h3> Carrito de Compras</h3>
        {cart.length === 0 ? (
          <p>No hay productos en el carrito.</p>
        ) : (
          <ul className="list-group">
            {cart.map((item, index) => (
              <li key={index} className="list-group-item d-flex justify-content-between">
                {item.name}
                <span>${item.price.toLocaleString()}</span>
              </li>
            ))}
          </ul>
        )}

        {cart.length > 0 && (
          <div className="mt-3">
            <h5>Total: ${cart.reduce((sum, item) => sum + item.price, 0).toLocaleString()}</h5>
            <button className="btn btn-danger" onClick={clearCart}>
              Vaciar carrito
            </button>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
